import {Image, TouchableOpacity, View} from "react-native";
import React from "react";
import {Props} from "./Deck";
import styles from "./styles";

export interface Props {
    swiper: CardSw;
}

const YesNo: React.FC<Props> = (props) => {

    return (
        <View style={styles.footer}>
            <View style={styles.buttonContainer}>
                <TouchableOpacity style={[styles.button, styles.red]} onPress={() => {
                    props.swiper.swipeLeft();
                }}>
                    <Image source={require('./assets/red.png')} resizeMode={'contain'} style={{ height: 62, width: 62 }} />
                </TouchableOpacity>
                <TouchableOpacity style={[styles.button, styles.orange]} onPress={() => {
                    props.swiper.goBackFromLeft();
                }}>
                    <Image source={require('./assets/back.png')} resizeMode={'contain'} style={{ height: 32, width: 32, borderRadius: 5 }} />
                </TouchableOpacity>
                <TouchableOpacity style={[styles.button, styles.green]} onPress={() => {
                    props.swiper.swipeRight();
                }}>
                    <Image source={require('./assets/green.png')} resizeMode={'contain'} style={{ height: 62, width: 62 }} />
                </TouchableOpacity>
            </View>

        </View>
    )
}

export default YesNo
